&quot;All glory to the Sontaran Empire!&quot;
I used Meshmixer to cut off the head of cerberus333's Sontaran clone model, and added on his Sontaran Bust model. Then I added my own base, which was made in OpenSCAD.
Printed full size, this proud Sontaran warrior should be about 1:35 scale.
